import re

def extract_numerical_features(text):
    features = []

    # Extracting mass fraction of elements
    element_mass_fractions = re.findall(r'(\w+)\-(\d+%|[\d.,]+)', text)
    for element in set(element_mass_fractions):
        if '%' in element[1]:
            min_value, max_value = map(float, element[1].split('%'))
            features.append({"вещество": element[0], "массовая доля": [min_value, max_value]})
        else:
            value = float(element[1])
            features.append({"вещество": element[0], "массовая доля": [value, None]})

    # Extracting other numerical values
    other_numerical_values = re.findall(r'\b\d+\.\d+(?:\s*\-\s*\d+\.\d*)?\b', text)
    for value in other_numerical_values:
        if '-' in value:
            min_value, max_value = map(float, value.split('-'))
            features.append({"параметр": value, "масса": [min_value, max_value]})
        else:
            value = float(value)
            features.append({"параметр": value, "масса": value})

    return features

