import re

def extract_numerical_features(text):
    features = []

    # Extracting mass fraction of elements
    element_mass_fractions = re.findall(r'(\w+)\-(\d+%|[\d.]+)%', text)
    for element, percentage in element_mass_fractions:
        if '%' in percentage:
            min_percentage, max_percentage = map(float, percentage.split('%'))
            features.append({"вещество": element, "массовая доля": [min_percentage, max_percentage]})
        else:
            features.append({"вещество": element, "массовая доля": float(percentage)})

    # Extracting quantity of products
    quantities = re.findall(r'\b\d+\b\s*([а-яё]+)\s*(?:кг|т|шт|п/э меш|вагон)', text)
    for quantity in quantities:
        features.append({"параметр": quantity[0], "количество": int(quantity[1])})

    # Extracting other numerical values and units
    other_numerical_values = re.findall(r'(\w+) \((\w+)\)', text)
    for feature_name, unit in other_numerical_values:
        features.append({"параметр": feature_name, "единица": unit})

    return features

